INSERT INTO `atualizacao` (`id`, `nome`, `atualizacao`) VALUES
(1, 'Joao Pedro', 'Agora definido usuario para login, podendo usar não somente o nome para isso como também qualquer subnick que desejar');
INSERT INTO `comentarios` (`id`, `nome`, `comentario`) VALUES
(6, 'Joao Pedro Cerqueira', 'Muito ótima a ideia e a interface!! Só queria pedir que deixasse uma observação no ato do cadastro para o usuário colocar o nome sem os acentos, pois ocorreram erros comigo quando coloquei os mesmos. Mas estão de parabéns!!!'),
(7, 'Pedro Henrique Cardoso dos Anjos', 'Achei interessante'),
(9, 'Josias da Silva Alves Souza', 'Ótima iniciativa pessoal!!\r\nParabéns....'),
(10, 'José Felipe Fernández', 'A interface é intuitiva e agradável. O sistema é simples, mas funcional.'),
(11, 'Andrey', 'Olá galera,\r\nO site está bem legal e vai ser uma ferramenta muito útil para a universidade. Conforme o público for conhecendo, acredito que muita gente pode usufruir! Estão de parabéns!'),
(12, 'Maycon Josué Nascimento', 'Gostei do projeto, parabéns pela iniciativa! '),
(13, 'João Victor Correia da Silva ', 'Projeto muito interessante vai ajudar a criar um grupo de estudo para poder melhorar o desempenho acadêmico. '),
(14, 'Priscila Santos', 'mutio bom. ajudou bastante para com que possamos estudar e tirar duvidas nota 10'),
(15, 'Lukas Araújo', 'Ótimo programa, com fácil entendimento. Muito bom, era o que realmente eu estava precisando, agora irei montar meus grupos de estudos.'),
(16, 'Carlos', 'Ótimo meio de compartilhar conteúdo e se reunir com outros estudantes para se preparar para a prova.'),
(17, 'kevinkastro2008@gmail.com', 'Quando você chega em casa, achando que só tem ovos na geladeira e se depara com um grande bolo de chocolate com morango e chantilly, consegue imaginar o meu sentimento ao abrir essa plataforma. É algo como uma surpresa exorbitante misturado com uma alegria nimia de poder desfrutar daquilo que não se esperava . Não posso deixar dar minhas congratulações pela criatividade, importante, e iniciativa dos colaboradores e simpatizantes . As dimensões que esse projeto pode tomar são inimagináveis, é um pequeno passo à universidade, mas um grande salto para a nação ! '),
(18, 'Higor Santos', 'O sistema possui uma proposta muito interessante e que agrega muito ao ganho de conhecimento, pois o estudo em grupo se mostra como uma ótima alternativa para os estudantes. O uso do sistema é intuitivo permitindo assim um uso fácil. Parabéns ao grupo.'),
(19, 'Walber', 'Uma ótima ferramenta para o desenvolvimento e aprendizado mútuo. Parabéns aos desenvolvedores.'),
(20, 'samuel rebouças de jesus', 'Site muito bem estruturado, que pode ser de grande valia para a integração e rendimento nos estudos dos estudantes da UFRB'),
(21, 'joão vitor da rocha cardoso', 'uma iniciativa muito interessante, que proporciona uma maior interação entre os discentes da UFRB e que possibilita um maior rendimento proporcionado pelo trabalho/estudo e grupo.\r\n\r\n*****= 5 estrelas'),
(22, 'Luan Oliveira Silva', 'Eu gostei da ideia, inovadora e super criativa. Aparentemente a plataforma do site parece ser boa e de fácil utilização, porém é preciso ver como ela se comportará com o acesso de vários estudantes. '),
